INSERT INTO `record` (`fid`, `ProjectTitle`, `ProjectDesc`, `Status`, `pid`, `ProjectTech`, `SDG`) VALUES
(208, 'Beyond Faces', '\"The \"\"Beyond Faces\"\" is a campus dating app that will provide a specialized platform tailored for college students, reimagining the traditional dating experience within the context of university life. This app aims to foster meaningful connections and relationships among college students by prioritizing shared interests, personalities, and campus experiences. This app will offer a secure, engaging, and campus-centric dating experience.\r\n\"\r\n', 1, 272, '\"Front End: HTML/ CSS/ JavaScript Back End: Node.js/ Python/ Swift/ Kotlin  \"', 'GOAL 10: Reduced Inequalities'),
(208, 'Barbie with Brains', '\" \"\"Barbie with Brains\"\" presents an innovative solution to enhance safety and convenience for individuals who need to interact with text-based information while engaged in activities such as driving or being in public spaces. This project introduces an automated text-to-voice conversion tool that leverages advanced technologies to transform written content into audible speech, enabling users to access information without the need to read.\r\n\r\n', 0, 273, '\"Front End: React/ Redux/ Web Speech API Back End: Natural Language Processing (NLP) Libraries & Spe', 'GOAL 9: Industry, Innovation and Infrastructure'),
(207, 'MentorEase', '\"The \"\"MentorEase\"\" app is a transformative solution designed to provide comprehensive mentoring and counseling support for MCA students. Rooted in the principles of personal growth and well-being, this application offers a secure and user-friendly platform where students can connect with mentors and counselors to navigate the challenges of academic life and personal development. \"\"MentorEase\"\" is poised to redefine the college journey by offering a digital ecosystem that supports students\' holistic development and empowers them to navigate their academic and personal challenges with confidence.\r\n\"\r\n', 1, 274, '\"Front End: HTML/ CSS/ JavaScript Back End: Node.js/ Python/ Swift/ Kotlin  \"', 'GOAL 4: Quality Education'),
(207, 'Outfit Smart', '\"\"\"OutfitSmart\"\" is a groundbreaking application that transforms the process of outfit selection for various events and occasions into a seamless and enjoyable experience. By utilizing a combination of user input, color analysis, and smart algorithms, this app provides users with personalized outfit recommendations tailored to the occasion\'s dress code, color preferences, and time constraints. \"\"OutfitSmart\"\" aims to simplify outfit decisions while helping users look their best for every event.\r\n\"\r\n', 1, 275, '\"Front End: HTML5 and CSS3/ React/ Material-UI or Ant Design/ Axios Back End: Node.js, Express.js/ MongoDB/ OpenWeatherMap API \"', 'GOAL 13: Climate Action'),
(207, 'MentorEase', 'The \"\"MentorEase\"\" app is a transformative solution designed to provide comprehensive mentoring and counseling support for MCA students. Rooted in the principles of personal growth and well-being, this application offers a secure and user-friendly platform where students can connect with mentors and counselors to navigate the challenges of academic life and personal development. \"\"MentorEase\"\" is poised to redefine the college journey by offering a digital ecosystem that supports students\' holistic development and empowers them to navigate their academic and personal challenges with confidence.\r\n', 1, 276, 'Front End: HTML/ CSS/ JavaScript Back End: Node.js/ Python/ Swift/ Kotlin ', 'GOAL 4: Quality Education'),
(210, 'Academic Supplies Management System (ASMS)', 'The Academic Supplies Management System (ASMS) is a web based application that will be designed to streamline the process of handling departmental requests for academic supplies within a store management context. The system enables authorized department personnel to efficiently request and acquire the required supplies while maintaining a user-friendly interface. ASMS features user authentication, access control, and a personalized dashboard for each user. Users can easily search for and request academic supplies, which undergo an availability check within the store\'s inventory. If the requested items are available, the system generates a request for immediate issuance. In cases where supplies are unavailable, users are seamlessly directed to a requisition page to initiate the procurement process. The requisition page facilitates the creation of purchase requests, incorporating an optional approval workflow for higher-level authorization. Upon approval, purchase orders are generated and sent to vendors for procurement. Users can monitor the status of their requests and orders through real-time updates and notifications. ASMS integrates with the store\'s inventory management system to ensure accurate tracking of item availability and stock levels. Additionally, the system provides comprehensive reporting and analytics for insights into departmental requests, inventory management, and procurement efficiency. ASMS aims to enhance the efficiency and transparency of academic supply management, offering a holistic solution to cater to the diverse needs of educational institutions.\r\n', 1, 277, 'Front End: HTML/ CSS/ JavaScript Back End: Node.js/ Python/ Swift/ Kotlin  \"', 'GOAL 12: Responsible Consumption and Production'),
(210, 'OptiSchedule', 'OptiSchedule‚Äù is an automated Time Table Management System with Faculty Load and Resource Constraints\"\". This project aims to streamline the process of creating and managing academic timetables within an educational institution. The system is designed to address the challenges of efficiently allocating faculty members, subjects, and rooms while adhering to various constraints such as faculty load, subject assignments, and room availability. The primary objective is to automate the timetable generation process while ensuring optimal use of resources and minimal conflicts.\r\n\r\nThe system provides a user-friendly interface for the coordinator to input essential data, including faculty loads, the number of subjects each faculty member teaches, and the availability of rooms or lab slots. Once this data is provided, the system employs sophisticated algorithms to suggest an optimal time schedule for classes, taking into account the specified constraints. The suggested timetable is aimed at minimizing conflicts, overlaps, and resource underutilization.\r\n', 1, 278, '\"Front End: HTML/ CSS/ JavaScript Back End: Node.js/ Python/ Swift/ Kotlin  \"', 'GOAL 4: Quality Education'),
(208, 'Project link hub', 'to allow students and faculty to work with collaboration', 1, 279, 'PHP', 'GOAL 4: Quality Education'),
(208, 'Online Auction System', 'Online Auction System is a web-based platform developed using HTML, CSS, and PHP, enabling users to bid on items in real-time, enhancing the buying and selling experience.', 1, 280, 'Java', 'SDG1 No Poverty'),
(208, 'Online Auction System', 'Online Auction System is a web-based platform developed using HTML, CSS, and PHP, enabling users to bid on items in real-time, enhancing the buying and selling experience.', 1, 281, 'Java', 'SDG1 No Poverty');

